import './App.css';

import Person from './Person/Person';

class App extends Component {
  render() {
  return (
    <div className="App">
     <h1>Hi, I am learning React</h1>
     <p>This is really working!</p>
     <Person name="Sonia" age="1" />
     <Person name="SoniaJ" age="2" />
    </div>
  );
  }
}

export default App;
